import React from 'react'

const CardUI = ({temp, date, icon, pres}) => {
    return (
        <div>
            <div>{date}</div>
            <div>{temp}</div>
            <img src= {icon} alt=''/>
            <div>{pres}</div>
        </div>
    )
}

export default CardUI
